import Isi from '../../komponen/isi';
import Layout from '../../layout/layouts';

class Data extends React.Component{
            render(){
                return(
                    <Layout>
                    <div class="data" >
                        <section >
                <div id="Festival" class="view"><h2>Festival</h2> </div>
            <div class="main_festival">
                <Isi link="/artikel/[kode]" as="/artikel/DWP X" img="/images/f1.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="DWP X" starting="Starting from" harga="Rp. 135.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Indonesia Nostalgia Festival" img="/images/f2.jpg" div="g_2" figure_class="bioskop_1" figcaption_class="" judul="Indonesia Nostalgia Festival" starting="Starting from" harga="Rp. 200.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Music Festival 1" img="/images/f3.jpg" div="g_3" figure_class="bioskop_1" figcaption_class="" judul="Music Festival 1" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Music Festival 2" img="/images/f4.jpg" div="g_4" figure_class="bioskop_1" figcaption_class="" judul="Music Festival 2" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>

                <Isi link="/artikel/[kode]" as="/artikel/Konser Raisa" img="/images/f5.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Konser Raisa" starting="Starting from" harga="Rp. 200.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Jessie J" img="/images/f6.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Jessie J" starting="Starting from" harga="Rp. 500.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Blues Festival" img="/images/f7.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Blues Festival" starting="Starting from" harga="Rp. 200.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Showcase Concert Afgan" img="/images/f8.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Showcase concert Afgan" starting="Starting from" harga="Rp. 350.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
            
                <Isi link="/artikel/[kode]" as="/artikel/Seafood Festival" img="/images/f9.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Seafood Festival" starting="Starting from" harga="Rp. 100.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Food Truck Festival" img="/images/f10.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Food Truck Festival" starting="Starting from" harga="Rp. 100.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Fall Festival" img="/images/f11.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Fall Festival" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                <Isi link="/artikel/[kode]" as="/artikel/Acoustic Festival" img="/images/f12.jpg" div="g_1" figure_class="bioskop_1" figcaption_class="" judul="Acoustic Festival" starting="Starting from" harga="Rp. 150.000" tanggal="📆 23 Mar 2019-23 Apr 2019" jam="🕚 09:00 - 21:00" tempat="📌 banyuwangi"/>
                
                </div></section>  
                    </div></Layout>
                )
            }
        }
       
        export default Data;
